    "title": "Fala Sunset. Screwpine, Pandanus tectorius, Mulinu'u Point, Apia, 'Upolu, Samoa",
    "description": "At evening Sony saw this from Mulinu'u Point, a peninsula on the west side of Apia's Harbor. It's an important place in Samoan history because it's the site of the capital of 'Upolu's kings, and some of the royalty is buried here. This Point is also the place where Germans raised their flag for the short-lived colony, German Samoa (1900-1914). There's lots more but I won't bore you...\nThe plant is a favorite of mine: Pandanus tectorius or Screwpine; the Samoans call it Fala. It's found all over the Pacific and Indian Oceans, and it has many uses, e.g. in basket weaving and also in cooking (think delicious Pandan Chicken!). I tried two small and delightful eateries on the point, but neither could satisfy my craving. So I settled for wonderful Oka and Poke instead! and enjoying the gentle breeze regarded Sunset. Meanwhile, all over those Tropical Seas, children are without doubt sucking on the kernels of Pandan's sweet fruit; you can see an unripe one high in our Screwpine.",
