    "description": "The sunset tonight in Sydney at Sawmillers Reserve.\nAt the end of French Street, McMahons Point.\n\nPhotographed at about 8.30pm this evening (20:30 hrs).\nWednesday, 6th December, 2023.\n\nSo tonight after finishing work at the Zenith Tower (Tower A ) in Chatswood, I noticed that the impending sunset over Sydney looked promising, though probably not in the top ten sunsets for 2023.\n\nI first had some 'Classic Ramen' at the Ippudo Ramen Restaurant in the Chatswood Interchange (Podium Level). This place is like the centre of Asia, but located here in Chatswood, Sydney, lol. I then raced down the Pacific Highway to McMahons Point and very luckily found parking outside the Blues Point Hotel.\n\nThe hotel, somewhat amazingly, was hosting a girls night out (of all things). Ignoring the very risque dancing to Billy Idol's 'Flesh For Fantasy' (1980s extended mix), I lugged the cameras down the hill to Sawmillers Reserve, where I was greeted by the usual gang of raucous kookaburras. Far better than scantily-clad females dancing to Billy Idol, I thought. Well maybe - or maybe not? But anyway, I then took a zillion sunset images. \n\nMy Canon EOS 5D Mk IV with the Canon EF 16-35mm f/4L lens.\n\nProcessed in Adobe Lightroom and PhotoPad Pro by NCH software.",
